import { useState } from "react";
import ReactDOM from "react-dom";

function CheckDiscountCard() {
  const [inputs, setInputs] = useState({});

  const handleChange = (event) => {
    const name = event.target.name;
    const value = event.target.value;
    setInputs(values => ({...values, [name]: value}))
  }

  const handleSubmit = (event) => {
    event.preventDefault();
    console.log(inputs);
    document.getElementById("result").innerHTML = "Based on your input Policy HAPPINESS is best for you";
    //alert(inputs);
  }

  return (
    <form onSubmit={handleSubmit}>
    <label>Please provide us the information below ! <br></br><br></br>
     Based on this, Our AI Rule Engine will find and offer <br></br>the policy that is best suited for your health.</label>
      <br></br>
      <br></br>
      <br></br>
      <label>Enter your name : 
      <input 
        type="text" 
        name="username" 
        value=  {inputs.username || ""} 
        onChange={handleChange}
      />
      <br></br>
      <br></br>
      </label>
      <label>Contact Number : 
        <input 
          type="number" 
          name="age" 
          value=  {inputs.age || ""} 
          onChange={handleChange}
        />
        </label>
        <br></br>
        <br></br>
        <label>Please enter your policy number :  
        <input 
          type="number" 
          name="smoke" 
          value=  {inputs.smoke || ""} 
          onChange={handleChange}
        />
        </label>
        <br></br>
        <br></br>
        <label>Email Address : 
        <input 
          type="text" 
          name="exercise" 
          value=  {inputs.exercise || ""} 
          onChange={handleChange}
        />
        </label>
        <br></br>
        <br></br>
        <input type="submit" />
    </form>
  )
}

export default CheckDiscountCard;
